lista = []

for cod_cliente, fecha in clientes:
    year, month, day = fecha.split('-')
    date = datetime(int(year), int(month), int(day))

    cant_asistencias = random.randint(15, 25)

    for i in range(cant_asistencias):
        days_to_add = random.randint(2, 7)
        delta = timedelta(days=days_to_add)
        date += delta

        lista.append('({}, \'{}\'),\n'.format(
            cod_cliente, date.strftime('%Y-%m-%d')
        ))
        
with open('Asistencia - Abonos.txt', 'w') as f:
    for item in set(lista):
        f.write(item)

